tps_dd_//doc.babylonjs.com/how_to/how_to_merge_meshes_qt_ rel_eq__qt_external nofollow_qt__gt_merge meshes_lt_/a_gt__co_ using light (not heavy) texture files etc.._lt_br /_gt_\n\tYou should freeze matrices and materials_co_ when it is possible to avoid useless computation._lt_br /_gt_\n\tEspecially in static scene_co_ there is a lot of _qt_manual_qt_ optimization you can do to improve the performance. _lt_br /_gt_\n\t_lt_br /_gt_\n\tOf course_co_ having as less lights as possible in your scene. 1 can be enough in a lot of scenario if you use tricks like ambient lighting or illumination maps._lt_br /_gt_\n\t_lt_br /_gt_\n\tFrom the screenshot of the debug layer_co_ I can see that there is 6 materials for 16 active meshes. You should try to merge meshes sharing the same material.\n_lt_/p_gt_\n\n_lt_p_gt_\n\t------- \n_lt_/p_gt_\n\n_lt_p_gt_\n\tOnce every little optimization done in your scene_co_ if the hardware is still not powerful enough to render the scene smoothy_co_ you may disable rendering features._lt_br /_gt_\n\tBabylonJS has its own Scene Optimizer to do it._lt_br /_gt_\n\tYou should have a look there _lt_span_gt__lt_span_gt__dd_ _lt_a href_eq__qt_https_dd_//doc.babylonjs.com/how_to/optimizing_your_scene_qt_ rel_eq__qt_external nofollow_qt__gt_https_dd_//doc.babylonjs.com/how_to/optimizing_your_scene_lt_/a_gt__lt_br /_gt_\n\tand here _dd_ _lt_a href_eq__qt_https_dd_//doc.babylonjs.com/how_to/how_to_use_sceneoptimizer_qt_ rel_eq__qt_external nofollow_qt__gt_https_dd_//doc.babylonjs.com/how_to/how_to_use_sceneoptimizer_lt_/a_gt__lt_br /_gt_\n\t_lt_br /_gt_\n\tTo conclude_co_ you can render your scene in a tiniyer resolution than your canvas_co_ but the result will be streched to the canvas resolution so it will of course be blurry._lt_/span_gt__lt_/span_gt__lt_br /_gt_\n\tIn my opinion_co_ this is something you should do only if you know you have already done every other optimization._lt_br /_gt_\n\tTo do so_co_ just use _lt_br /_gt_\n\tengine.setHardwareScalingLevel _eq_ n (with n &lt_sm_ 1)_sm_\n_lt_/p_gt_\n\n_lt_p_gt_\n\tSee _lt_a href_eq__qt_http_dd_//doc.babylonjs.com/api/classes/babylon.engine_qt_ rel_eq__qt_external nofollow_qt__gt_http_dd_//doc.babylonjs.com/api/classes/babylon.engine_lt_/a_gt__lt_br /_gt_\n\t_lt_br /_gt_\n\t_lt_br /_gt_\n\tHope it helps!\n_lt_/p_gt_\n\n\n\t\t\t\n\t\t_lt_/div_gt_\n\n\t\t_lt_div class_eq__qt_ipsI_qt__gt__lt_/div_gt__lt_/div_gt_"},{"Owner":"leanderr","Date":"2018-05-23T13:20:39Z","Content":"_lt_div class_eq__qt_mages_qt__gt_\n\t\t\t\n_lt_p_gt_\n\tI believe the first link you sent absolutely does it for me. I_t_ve been looking through optimization stuff for half an hour without finding this article. Must have been blind. Thanks so much.\n_lt_/p_gt_\n\n_lt_p_gt_\n\tSOLVED_dd_ _lt_a href_eq__qt_https_dd_//doc.babylonjs.com/how_to/optimizing_your_scene_qt_ rel_eq__qt_external nofollow_qt__gt_https_dd_//doc.babylonjs.com/how_to/optimizing_your_scene_lt_/a_gt_\n_lt_/p_gt_\n\n_lt_p_gt_\n\tI still feel a bit puzzled what _qt_frame_co_ inter frame_co_ meshes selection_co_ render targets_qt_ and stuff on the stats page mean. The Debug Layer Documentation does not really provide these answers. _lt_a href_eq__qt_https_dd_//doc.babylonjs.com/features/playground_debuglayer#tool-bar_qt_ rel_eq__qt_external nofollow_qt__gt_https_dd_//doc.babylonjs.com/features/playground_debuglayer#tool-bar_lt_/a_gt_\n_lt_/p_gt_\n\n_lt_p_gt_\n\tMayb we can crowdsource a little guide like _qt_if you stat X exploding in your debug layer try solution Y because Z_qt_?\n_lt_/p_gt_\n\n\n\t\t\t\n\t\t_lt_/div_gt_\n\n\t\t_lt_div class_eq__qt_ipsI_qt__gt__lt_/div_gt__lt_/div_gt_"},{"Owner":"Deltakosh","Date":"2018-05-23T20:23:46Z","Content":"_lt_div class_eq__qt_mages_qt__gt_\n\t\t\t\n_lt_p_gt_\n\tCrowdsourcing doc_dd_ Would love to get some help in this front _lt_span_gt__lt_img alt_eq__qt__dd_)_qt_ data-emoticon_eq__qt_true_qt_ height_eq__qt_20_qt_ src_eq__qt_http_dd_//www.html5gamedevs.com/uploads/emoticons/default_smi